var StatusNotFoundView = fmt.Sprintf(StaticHtml, "NOT FOUND", "<h1>404 NOT FOUND</h1>")

const (
	red   = "\033[31m"
	green = "\033[32m"
	end   = "\033[0m"
)

func ColorPrint(out string, color string) {
	switch color {
	case "green":
		fmt.Printf("%s%s%s\n", green, out, end)
		break
	case "red":
		fmt.Printf("%s%s%s\n", red, out, end)
		break
	}
}
